import React from "react";
import "./Checkout.css";

function Checkout() {
  return (
    <div className="checkout">
      <div className="checkout-left">
        <img src="" alt="Checkout Ad" className="checkout-ad" />
      </div>
      <div className="checkout-right"></div>
    </div>
  );
}

export default Checkout;
